package com.breezing.health.transation;public class DataInfo {    private String name;    private String type;    private String version;    private String object;    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getType() {        return type;    }    public void setType(String type) {        this.type = type;    }    public String getVersion() {        return version;    }    public void setVersion(String version) {        this.version = version;    }    public String getObject() {        return object;    }    public void setObject(String object) {        this.object = object;    }}